import React from "react";
import { useParams } from "react-router-dom";
import DataTable from "./DataTable";
import "./WorkoutPlan.css";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";

const WorkoutPlan = () => {
  const { date } = useParams();
  const [bodyPart, setBodyPart] = useState('');

  const updateBodyPart = (event) => {
    setBodyPart(event.target.value);
  }
  return (
    <div className="workout-plan">
      <h2 id="title">Workout Plan for {date}</h2>
      <div className="select-workout-type">
        <FormControl required sx={{ m: 1, minWidth: 80 }}>
          <InputLabel
            id='demo-simple-select-required-label'
            style={{ marginLeft: "1.5em" }}
          >
            Choose a Body Part You Want to Work 
          </InputLabel>
          <Select
            labelId='demo-simple-select-required'
            id='demo-simple-select-required'
            value={bodyPart}
            onChange={updateBodyPart}
            label="bodyPart"
            style={{ width: "15rem", marginLeft: "1.5em" }}
          >
            <MenuItem value={"Male"}>Male</MenuItem>
            <MenuItem value={"Female"}>Female</MenuItem>
            <MenuItem value={"Other"}>Other</MenuItem>
          </Select>
        </FormControl>
      </div>
      <div className="input-table">
        <DataTable />
      </div>
    </div>
  );
};

export default WorkoutPlan;
